ADOBE PHOTOSHOP CS5 TRAINING DVD FOR WINDOWS &amp; MAC

Lynda.com Adobe Photoshop CS5 Prepress And Printing.

In Photoshop CS5: Prepress and Printing, author Taz Tally shows how to prepare Photoshop files for a wide variety of printing devices, including offset printing presses, digital presses, wide format, large gamut inkjet printers, and toner-based printers. This course covers image adjustments, colour mode conversions, and selecting the right format for print, as well as assigning and building colours to achieve desired print colours and using automation to streamline the prepress workflow. Exercise files accompany the course.
Topics include:

    * Understanding RGB and CMYK bit depth
    * AM versus FM screening
    * Working with device color gamuts and profiles
    * Making image adjustments before printing
    * Choosing the correct file format for output
    * Assigning spot and process colors
    * Comparing editable and raster type
    * Sharpening for print
    * Printing to grayscale
    * Proofing images
    * Recording actions to automate printing-related tasks 

